Make chocolate cupcakes. Decorate as follows to create the owl:
Pipe chocolate frosting in two large blobs or flatten out two large circles of black/brown fondant for the base of eye holes. {"smallUrl":"https://www.wikihow.com/images/thumb/a/a4/1912706-3a.jpg/v4-460px-1912706-3a.jpg","bigUrl":"https://www.wikihow.com/images/thumb/a/a4/1912706-3a.jpg/v4-760px-1912706-3a.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Make two white circles in sugar paste. Place these on top of the chocolate frosting blobs. {"smallUrl":"https://www.wikihow.com/images/thumb/9/9a/1912706-3b.jpg/v4-460px-1912706-3b.jpg","bigUrl":"https://www.wikihow.com/images/thumb/9/9a/1912706-3b.jpg/v4-760px-1912706-3b.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Using frosting as glue, stick one brown M&M or chocolate drop to the center of the sugar paste circle to form the pupil. Do for each eye. {"smallUrl":"https://www.wikihow.com/images/thumb/9/91/1912706-3c.jpg/v4-460px-1912706-3c.jpg","bigUrl":"https://www.wikihow.com/images/thumb/9/91/1912706-3c.jpg/v4-760px-1912706-3c.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Using frosting as glue, stick on a cashew nut on as a beak. Place the large end of the cashew nut down between the two eyes, with the smaller end facing down the owl's face. For a cashew-free version, use a round candy for the beak and simply push in half, letting the other half poke out. {"smallUrl":"https://www.wikihow.com/images/thumb/d/df/1912706-3d.jpg/v4-460px-1912706-3d.jpg","bigUrl":"https://www.wikihow.com/images/thumb/d/df/1912706-3d.jpg/v4-760px-1912706-3d.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Add two small curled pieces of licorice or raisins above the eyes to form eyebrows. Position to form a wise expression! {"smallUrl":"https://www.wikihow.com/images/thumb/4/46/1912706-3e.jpg/v4-460px-1912706-3e.jpg","bigUrl":"https://www.wikihow.com/images/thumb/4/46/1912706-3e.jpg/v4-760px-1912706-3e.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Make chocolate cupcakes. Then create the owl as follows:
Frost the cupcake with chocolate frosting. {"smallUrl":"https://www.wikihow.com/images/thumb/6/6a/1912706-4a.jpg/v4-460px-1912706-4a.jpg","bigUrl":"https://www.wikihow.com/images/thumb/6/6a/1912706-4a.jpg/v4-760px-1912706-4a.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Pull apart some Oreo cookies. You'll only be using the half that keeps the cream intact (use the other half for making a cheesecake base or similar). {"smallUrl":"https://www.wikihow.com/images/thumb/4/48/1912706-4b.jpg/v4-460px-1912706-4b.jpg","bigUrl":"https://www.wikihow.com/images/thumb/4/48/1912706-4b.jpg/v4-760px-1912706-4b.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Stick two Oreo halves onto the cupcake to form the base of the eyes. {"smallUrl":"https://www.wikihow.com/images/thumb/7/7e/1912706-4c.jpg/v4-460px-1912706-4c.jpg","bigUrl":"https://www.wikihow.com/images/thumb/7/7e/1912706-4c.jpg/v4-760px-1912706-4c.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Using the frosting, stick on a chocolate covered raisin on each Oreo eye. This serves as the pupils. Also use droplets of icing as an alternative. {"smallUrl":"https://www.wikihow.com/images/thumb/2/2b/1912706-4d.jpg/v4-460px-1912706-4d.jpg","bigUrl":"https://www.wikihow.com/images/thumb/2/2b/1912706-4d.jpg/v4-760px-1912706-4d.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
