</p></div>"}

Use a white chocolate drop for a beak. Slip the beak chocolate in halfway, leaving the other half sticking up as the beak. {"smallUrl":"https://www.wikihow.com/images/thumb/e/eb/1912706-4e.jpg/v4-460px-1912706-4e.jpg","bigUrl":"https://www.wikihow.com/images/thumb/e/eb/1912706-4e.jpg/v4-760px-1912706-4e.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by/3.0/">Creative Commons</a>
</p></div>"}

Break off little chocolate sticks and insert at the top for the owl's eyebrows. {"smallUrl":"https://www.wikihow.com/images/thumb/9/9e/1912706-4f.jpg/v4-460px-1912706-4f.jpg","bigUrl":"https://www.wikihow.com/images/thumb/9/9e/1912706-4f.jpg/v4-760px-1912706-4f.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":505.27472527472526,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
